import React from "react";
import ReactDom from "react-dom/client";
import "./index.css"

class App extends React.Component{
    render() {
        return (
            <div>
                <h1>Hello</h1>
            </div>
        )
    }
}

const root = ReactDom.createRoot(document.getElementById("root"));
root.render(<App />);
